import React from 'react';
import Tables from '../Tables/Tables';

const EmployeeList = ({ employees, admins }) => {
  if (!Array.isArray(employees) || !Array.isArray(admins)) {
    return <div>No data available or still loading...</div>;
  }

  // Filter out employees that match any admin's key properties
  const filteredEmployees = employees.filter(
    (employee) =>
      !admins.some(
        (admin) =>
          admin.nom === employee.nom &&
          admin.postNom === employee.postNom &&
          admin.preNom === employee.preNom &&
          admin.dateDeNaissance === employee.dateDeNaissance
      )
  );

  return (
    <div>
      <h2>Admin List</h2>
      {admins.map((admin) => (
        <Tables
          key={`admin-${admin._id}`} // Unique key for admin
          nom={admin.nom}
          postNom={admin.postNom}
          preNom={admin.preNom}
          date={admin.dateDeNaissance}
          lieu={admin.villeDeNaissance}
          function={admin.role}
          adresse={admin.address}
          commune={admin.commune}
          quartier={admin.quartier}
        />
      ))}
      <h2>Employee List</h2>
      {filteredEmployees.map((employee) => (
        <Tables
          key={`employee-${employee._id}`} // Unique key for employee
          nom={employee.nom}
          postNom={employee.postNom}
          preNom={employee.preNom}
          date={employee.dateDeNaissance}
          lieu={employee.villeDeNaissance}
          function={employee.role}
          adresse={employee.address}
          commune={employee.commune}
          quartier={employee.quartier}
        />
      ))}
    </div>
  );
};

export default EmployeeList;
